import React from 'react';
import Menu from './components/Menu';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
function App(){
  return(
    <div>
      <BrowserRouter>
      <Routes>
        <Route path='/' to={<Menu/>}>
          <Route/>
        </Route>
      </Routes>

      </BrowserRouter>

    </div>
  )
}
export default App;
